// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

interface ISyndicateClosedEndFundManagerLogicV0 {
    function createSyndicate(
        uint256 managerManagementFeeBasisPoints,
        uint256 managerDistributionShareBasisPoints,
        uint256 syndicateDistributionShareBasisPoints,
        uint256 numMembersMax,
        address depositERC20Address,
        uint256 depositMemberMin,
        uint256 depositMemberMax,
        uint256 depositTotalMax,
        uint256 dateClose,
        bool modifiable,
        bool allowlistEnabled,
        bool transferable
    ) external;

    function managerSetManagerPending(
        address syndicateAddress,
        address managerPendingAddress
    ) external;

    function managerPendingConfirmAndSetManagerFeeAddress(
        address syndicateAddress,
        address managerFeeAddress
    ) external;

    function managerPendingConfirm(address syndicateAddress) external;

    function managerSetManagerFeeAddress(
        address syndicateAddress,
        address managerFeeAddress
    ) external;

    function managerSetManagerFees(
        address syndicateAddress,
        uint256 managerManagementFeeBasisPoints,
        uint256 managerDistributionShareBasisPoints
    ) external;

    function managerSetSyndicateDistributionShare(
        address syndicateAddress,
        uint256 syndicateDistributionShareBasisPoints
    ) external;

    function managerAssessManagementFee(
        address syndicateAddress,
        address feeERC20Address,
        uint256 amount
    ) external;

    function managerSetNumMembersMax(
        address syndicateAddress,
        uint256 numMembersMax
    ) external;

    function managerSetNumMembersMaxToCurrent(address syndicateAddress)
        external;

    function managerSetDateClose(address syndicateAddress, uint256 dateClose)
        external;

    function managerCloseSyndicate(address syndicateAddress) external;

    function managerSetMetadata(
        address syndicateAddress,
        string[] calldata metadataKeys,
        string[] calldata metadataValues
    ) external;

    function managerEmitMemo(
        address syndicateAddress,
        bytes32 hexadecimalHash,
        uint8 hashFunction,
        uint8 hashSize
    ) external;
}
